import React from "react";
import Form from "./Form";

function NewCalculation (props) {
        const saveYearlyDataHandler = (enteredYearlyData) => {
            const yearlyData = {
                ...enteredYearlyData,
            }
            props.onAddExpense(yearlyData);

        };

    return(
        <Form onSaveYearlyData={saveYearlyDataHandler} />
        )    
}

export default NewCalculation;
